// Assuming KeyObj is defined as:\npublic class KeyObj {\n    public string Str1 { get; }\n    public string Str2 { get; }\n    public int ID { get; private set; }\n\n    // Static counter to ensure unique IDs\n    private static int _nextID = 0;\n\n    public KeyObj(string str1, string str2) {\n        Str1 = str1;\n        Str2 = str2;\n        ID = _nextID++;\n    }\n}\n\n// Usage with Dictionary:\nvar dictionary = new Dictionary<int, TValue>();\nvar keyObj = new KeyObj("somestring", "anotherstring");\n\ndictionary[keyObj.ID] = someValue; // Add value to dictionary